import React from 'react';
import { createMaterialTopTabNavigator } from "@react-navigation/material-top-tabs";
import Logisticscreen from '../../features/logictics/screens/logisticscreen';
import LogisticBooking from '../../features/logictics/screens/logisticBooking';
import { createStackNavigator } from '@react-navigation/stack'
import Stores from '../../features/Stores/Stores.screen'
import Ecommerce from '../../features/ecommerce/ecommerce'
import Ecommerce2 from '../../features/ecommerce/ecommerce2'
import Ecommerce3 from '../../features/ecommerce/ecommerce3'
import Ecommerce4 from '../../features/ecommerce/ecommerce4'
import Ecommerce5 from '../../features/ecommerce/ecommerce5'
import Ecommerce6 from '../../features/ecommerce/ecommerce6'
import Ecommerce7 from '../../features/ecommerce/ecommerce7'
import Ecommerce8 from '../../features/ecommerce/ecommerce8'
import Fintech1 from '../../features/Fintech/fintech1'
import MobileTopUp2 from '../../features/Fintech/mobileTopUp2'
import MobileTopUp from '../../features/Fintech/mobileTopUp'
import Hotel from '../../features/Fintech/hotel'


/// just the way we use the stack navigation
const Tabs = createMaterialTopTabNavigator();
const Screens = createStackNavigator();

const NewScreen = ()=>{
    return(
         <Screens.Navigator>

                <Screens.Screen
                    name="Ecommerce"
                    component={Ecommerce}
                    options={{
      headerShown: false,}}
                />
                <Screens.Screen
                    name="Ecommerce2"
                    component={Ecommerce2}
                    options={{
      headerShown: false,}}
                />
                <Screens.Screen
                    name="Ecommerce3"
                    component={Ecommerce3}
                    options={{
      headerShown: false,}}
                />
                <Screens.Screen
                    name="Ecommerce4"
                    component={Ecommerce4}
                    options={{
      headerShown: false,}}
                />
                <Screens.Screen
                    name="Ecommerce5"
                    component={Ecommerce5}
                    options={{
      headerShown: false,}}
                />
                <Screens.Screen
                    name="Ecommerce6"
                    component={Ecommerce6}
                    options={{
      headerShown: false,}}
                />
                <Screens.Screen
                    name="Ecommerce7"
                    component={Ecommerce7}
                    options={{
      headerShown: false,}}
                />
                <Screens.Screen
                    name="Ecommerce8"
                    component={Ecommerce8}
                    options={{
      headerShown: false,}}
                />
            </Screens.Navigator>


        )
    
};


const FintechScreen = ()=>{
    return(
    <Screens.Navigator>
        <Screens.Screen
                    name="Fintech1"
                    component={Fintech1}
                    options={{
      headerShown: false,}}
                />
        <Screens.Screen
                    name="MobileTopUp"
                    component={MobileTopUp}
                    options={{
      headerShown: false,}}
                /> 
        <Screens.Screen
                    name="MobileTopUp2"
                    component={MobileTopUp2}
                    options={{
      headerShown: false,}}
                />
         <Screens.Screen
                    name="Fintech4"
                    component={Fintech4}
                    options={{
      headerShown: false,}}
                />                          
    </Screens.Navigator>
    )
   } 

export const AccountNavigator = () => {

    return (
        <Tabs.Navigator
            headerMode="none"
            // screenOptions={{
            //     activeTintColor: "#FFC300",
            //     inactiveTintColor: "#353935",
            //     style: {
            //         labelStyle: { fontSize: 1 },
            //     }
            // }}
            screenOptions={{
                activeTintColor: "#50d3a7",
                 tabBarActiveTintColor: '#fff',
              tabBarInactiveTintColor: '#ddd',
                inactiveTintColor: "white",
                tabBarPressColor: '#cec6c6',
                tabBarShowIcon: true,
                tabBarIndicatorStyle: {
                    backgroundColor: '#9A8340',
                },

                tabBarStyle: {
                    borderTopColor: "9A8340",
                    borderTopWidth: 2,
                    elevation: 10,
                    backgroundColor: '#0B090A',
                    borderRadius: 1

                },
            }}
        // tabBarOptions={{
        //     activeTintColor: '#ffffff',
        //     inactiveTintColor: '#ffffff',
        //     showIcon: true,
        //     pressColor: '#856',
        //     scrollEnabled: false,
        //     tabStyle: { backgroundColor: '#000', borderRadius: 10, margin: 12, justifyContent: 'center', alignContent: 'center' },
        //     indicatorStyle: { backgroundColor: '#987', opacity: 0.05 },
        //     style: {
        //         backgroundColor: '#000000', borderRadius: 30, margin: 24, height: 72, width: '90%',
        //         labelStyle: { fontSize: 2 },
        //     }
        // }}
        >

            <Tabs.Screen
                name="LOgistic"
                component={Logisticscreen}
            />
            
            <Tabs.Screen
                name="Store"
                component={NewScreen}
                options={{
      headerShown: false,}}
            />
            <Tabs.Screen
                name="Puddle"
                component={Logisticscreen}
            />

            <Tabs.Screen
                name="Yoris Pay"
                component={FintechScreen}
            />

        </Tabs.Navigator >


    )
}










const Stack = createStackNavigator();
// JUST THE WAY IT SOUNDS WE ARE STACKING THE VIEWS
// read the documentation

export const logisticNavigator = () => {
    return (
        <Stack.Navigator screenOptions={{ headerShown: false }}>

            <Stack.Screen name="Main" component={Logisticscreen} />
            <Stack.Screen name="logisticBooking" component={LogisticBooking} />



        </Stack.Navigator>
    )
}
